(30, '1809044', 'เพิ่มเติม เหมาทำสีรอบคัน 25,000 บาท/เบอร์สี N-RC1P (สีแดง)', '2018-09-19 13:40:01', 'admin'),
(31, '1809041', 'เซ็นเซอร์หน้าซ้ายไเสียหายใช้งานไม่ได้ รื้อดูหัวแตก ซ่อมมาแล้ว ', '2018-09-20 09:20:22', 'chonlapin'),
(32, '1807027', 'เข้ามาแก้ไขงานซ่อม สีกระเทาะะ ประตูหลังซ้าย เรียบร้อยแล้ว/รายการของ ผ้ายางหน้า พรมในฝาท้าย มีครบ แจ้งลูกค้ารับทราบแล้ว วิเชฐ', '2018-09-21 14:37:20', 'admin'),
(33, '1809061', 'ไม่จอดซ่อม นำรถเข้ามาเปลี่ยนอะไหล่/รอทำสีเสกิร์ตหน้า และนัดเข้ามาใส่', '2018-09-23 12:32:33', 'admin'),
(34, '1809089', 'รอตรวจสอบการเก็บค่า EXCESS จากระบบ i-Claim หาก ป ไม่เรียกเก็บให้ติดต่อเพื่อคืนเงินกับลูกค้า/รับเงินมาในวันรับรถ 1000 บาท REC13 796.10.61', '2018-10-07 19:49:32', 'admin'),
(35, '1809053', 'ค้างชำระค่า EXCESS 4000 บาท', '2018-10-07 20:15:34', 'admin'),
(36, '1809023', 'ลูกค้าติดต่อสอบถามอะไหล่/ แจ้งกลับว่ายังมาไม่ครบ จะตรวจสอบและติดต่อกลับว่าได้อะไหล่เมื่อไหร่', '2018-10-08 13:27:02', 'admin'),
(37, '1809023', 'แจ้งลูกค้า ว่าตรวจสอบรายการอะไหล่ผิดคัน ตอนนี้อะไหล่มาครบแล้วสามารเข้าซ่อมได้เลย ลูกค้าแจ้งกลับว่า จะโทรติดต่อกลับมานัดวันที่เข้าซ่อมเอง ชื่อคุณไพฑูร', '2018-10-08 13:30:31', 'admin'),
(39, '1808047', 'ทำสีรอบคัน 22,000 บาท รวมเปลี่ยนอะไหล่ กันชนหลัง เทียม', '2018-10-08 13:57:28', 'chonlapin'),
(41, '1810018', 'เพิ่มเติมปะผุบังโคลนหลัง L R 5000 บาท ลูกค้ารับทราบแล้ว', '2018-10-08 14:35:32', 'admin'),
(42, '1810028', 'ทำเงินสด ขอเอกสารเรียกร้อง (เจ้าพระยา) ลูกค้ายื่นเอง', '2018-10-09 12:43:35', 'admin'),
(43, '1810028', 'รายการซ่อม/ เสกิร์ตหน้าเปลี่ยน(รอราคาอะไหล่) ทำสี 1,500 บาท, กันชนหน้า ทำสี 2,000 บาท, คิ้วล้อหน้าขวา ทำสี ดำด้าน เปลี่ยนยาง 350 บาท, ไฟตัดหมอกหน้า ขวา (รอราคาอะไหล่), ฝาครอบไฟตัดหมอก (รอราคาอะไหล่), ขัดไฟคู่หน้า 500 บาท ', '2018-10-09 12:47:07', 'admin'),
(44, '1809060', 'เข้าซ่อม จันทร์ที่ 15/10/61 จอดซ่อม 3 วัน ประกันภัยยังไม่อนุมัติ', '2018-10-11 15:20:20', 'admin'),
(45, '1807077', 'รอเสนอเปลี่ยน เสกิร์ตบันไดL R และเสกิร์ตหน้า ทำสีตัวรถเสร็จ ให้ลูกค้าไปใช้ก่อน', '2018-10-11 17:04:04', 'admin'),
(46, '1809016', 'ลูกค้า ขอให้เสนอเพิ่มเติมรายการทำสีกันชนหน้า หากประกันภัยอนุมัติแล้วให้โทรแจ้งเข้ามาทำเพิ่ม', '2018-10-12 17:38:42', 'admin'),
(47, '1809082', 'รอล้อแม็คส่งซ่อม ได้แ้วแจ้งลูกค้าเข้ามาใส่', '2018-10-14 01:57:59', 'admin'),
(48, '1809045', 'เพิ่มเติมทำสีรอบคัน 16,000 บาท / สอบถามราคาหุ้มเบาะคู่หน้าเป็นสีดำ (ทรงเดิม)-โทรแจ้งราคาก่อนทำ / สอบถามราคาคิ้วกันสาดประตู แค็ป (ต้องการแบบใหญ่ๆ)-โทรแจ้งราคาก่อนทำ', '2018-10-15 14:51:31', 'admin'),
(50, '1810008', 'เพิ่มเติม เปลี่ยนสี Dark Blue ', '2018-10-15 15:44:51', 'admin'),
(51, '1810008', 'ราคา 9,500 บาท ลูกค้าตกลงจัดซ่อม', '2018-10-15 15:45:31', 'admin'),
