INSERT INTO `tb_news` (`i_news`, `s_img_p1`, `s_img_p2`, `i_index`, `s_subject`, `s_detail`, `i_view`, `i_vote`, `d_create`, `d_update`, `s_create_by`, `s_update_by`, `s_status`) VALUES
(7, '201801152241151.jpg', '201801152241152.jpg', 1, 'Suzuki Swift 2018 ใหม่ เคาะวันเปิดตัวในไทย 8 กุมภาพันธ์นี้', '<p><strong><a href=\"http://auto.sanook.com/car/suzuki/\" title=\"Suzuki\">Suzuki</a>&nbsp;<a href=\"https://auto.sanook.com/61657/\" rel=\"tag\" target=\"_blank\" title=\"swift 2018\">Swift 2018</a>&nbsp;ใหม่ เตรียมเปิดตัวในไทยอย่างเป็นทางการครั้งแรกวันที่ 8 กุมภาพันธ์ที่จะถึงนี้</strong></p>\r\n\r\n<p><a href=\"http://auto.sanook.com/5704/\" target=\"_blank\" title=\"Suzuki Swift\">Suzuki Swift</a>&nbsp;2018 เวอร์ชั่นไทยที่กำลังจะถูกเปิดตัวดังกล่าว จะยังคงถูกติดตั้งเครื่องยนต์เบนซิน Dualjet ขนาด 1.2 ลิตร ซึ่งสเป็คญี่ปุ่นมีกำลังสูงสุด 91 แรงม้า ที่ 6,000 รอบต่อนาที แรงบิดสูงสุด 118 นิวตัน-เมตร ที่ 4,400 รอบต่อนาที ส่งกำลังด้วยเกียร์อัตโนมัติ CVT และเกียร์ธรรมดา 5 สปีดให้เลือก โดยไร้วี่แววเครื่องยนต์ไฮบริดและเครื่องยนต์เทอร์โบ Boosterjet แบบในตลาดญี่ปุ่น</p>\r\n\r\n<p>สำหรับ Suzuki Swift 2018 เวอร์ชั่นญี่ปุ่น มีการปรับดีไซน์ภายนอก-ภายในต่างไปจากรุ่นปัจจุบันอย่างชัดเจน ภายนอกถูกติดตั้งไฟหน้าแบบโปรเจคเตอร์ LED พร้อม Daytime Running Light แบบ LED, มือเปิดประตูคู่หลังถูกซ้อนไว้บริเวณกรอบหน้าต่าง มีการติดตั้งระบบความปลอดภัยระดับสูง เช่น ระบบป้องกันการชนด้านหน้า Dual Sensor Brake Support ทำงานด้วยกล้องและเรดาร์ที่ติดตั้งบริเวณกระจกบังลมด้านหน้า, ระบบเตือนเมื่อออกนอกเลน, ระบบเปิดไฟสูงอัตโนมัติ, ระบบเตือนเมื่อรถคันหน้าเคลื่อนตัว เป็นต้น</p>\r\n\r\n<p>ตัวถังของ Suzuki Swift 2018 ใหม่ ยังคงมีขนาดใกล้เคียงกับรุ่นปัจจุบัน โดยมีความยาวตัวถัวอยู่ที่ 3,840 มิลลิเมตร ความกว้าง 1,695 มิลลิเมตร ความสูง 1,500 มิลลิเมตร ความยาวฐานล้อ 2,450 มิลลิเมตร (รุ่นปัจจุบันมีความยาวฐานล้อ 2,430 มิลลิเมตร) มาพร้อมโครงสร้าง HEARTECH ใหม่ ที่<a href=\"http://auto.sanook.com/5246/\" target=\"_blank\" title=\"ซูซูกิ\">ซูซูกิ</a>ระบุว่ามีน้ำหนักเบาลงแต่แข็งแรงมากขึ้น เพื่อช่วยเพิ่มอรรถรสในการขับขี่ ทั้งการขับด้วยความเร็วสูง, การเลี้ยว และการเบรก</p>\r\n\r\n<p><strong>&nbsp;&nbsp;&nbsp;&nbsp; รายละเอียดและราคาจำหน่ายต้องรอเปิดตัววันที่ 8 กุมภาพันธ์นี้</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n', 0, 0, '2018-01-15 22:41:15', '2018-01-15 22:41:15', 'admin', 'admin', 'A'),
(8, '201801152245531.jpg', '201801152245532.jpg', 1, 'ปีนี้เลิกแข่งตัดราคา ประกันภัยรถยนต์', '<div style=\"background:#eeeeee; border:1px solid #cccccc; padding:5px 10px\"><span style=\"font-size:12px\">แนวโน้มอัตราเบี้ย ประกันภัยรถยนต์ คงไม่รุนแรง ไม่ลดราคาต่ำเหมือนปี 2560 ทุกบริษัทรู้ต้นทุนตัวเองอยู่เท่าใด</span></div>\r\n\r\n<div style=\"background:#eeeeee; border:1px solid #cccccc; padding:5px 10px\"><span style=\"font-size:12px\">ประกันวินาศภัยคาด ปีนี้ไม่แข่งตัดค่าเบี้ย ประกันภัยรถยนต์ ยึดตามต้นทุน ส่วนเบี้ย ประกันภัย ต่อไอเออาร์ขึ้น 10%</span></div>\r\n\r\n<div style=\"background:#eeeeee; border:1px solid #cccccc; padding:5px 10px\"><span style=\"font-size:12px\">ประธานสภาธุรกิจประกันภัยไทย เปิดเผยถึงแนวโน้มธุรกิจ ประกันภัย ในปีนี้ว่า ในส่วนของ ประกันภัยรถยนต์ นั้น ด้านอัตราเบี้ยคงไม่รุนแรง และไม่ลดราคาต่ำเหมือนกับปี 2560 เนื่องจากปัจจุบันทุกบริษัทรู้แล้วว่าต้นทุนของตัวเองอยู่เท่าใด หากยังแข่งขันตัดราคาเพื่อให้ได้งานเพียงอย่างเดียว โดยไม่คำนึงถึงต้นทุนที่แท้จริง ก็ยิ่งทำให้บริษัทนั้นขาดทุน และอาจส่งผลกระทบต่อฐานะการเงินได้</span></div>\r\n\r\n<div style=\"background:#eeeeee; border:1px solid #cccccc; padding:5px 10px\"><span style=\"font-size:12px\">&quot;ในเรื่องของ ประกันภัยรถยนต์ ตอนนี้เราก็พัฒนามาถึงจุดหนึ่ง คือ อัตราการเกิดเคลมลดลงจากเดิม 1 เคลม/กรมธรรม์ ตอนนี้ก็เหลือ 0.8 เคลม/กรมธรรม์ ซึ่งเกิดจากการรณรงค์ลดอุบัติเหตุ และบังคับใช้กฎหมายที่เข้มงวด แต่<strong>ในส่วนของสินไหมต่อรายเพิ่มสูงขึ้</strong>น แม้ว่าอัตราการเกิดเหตุลดลงก็ตาม&quot;</span></div>\r\n\r\n<div style=\"background:#eeeeee; border:1px solid #cccccc; padding:5px 10px\"><span style=\"font-size:12px\">นอกจากนี้ ในส่วนของ ประกันภัยทรัพย์สิน (ไอเออาร์) ก็มีแนวโน้มที่ค่าเบี้ย ประกันภัย จะปรับขึ้น ตามความเสี่ยงภัยทั่วโลกในปี 2560 ที่มีภัยธรรมชาติขนาดใหญ่เกิดขึ้นเป็นจำนวนมาก ส่งผลให้ บริษัทประกันภัย ต่อต่างชาติ หรือรีอินชัวเรอส์ ต้องปรับเบี้ยในปีนี้เพิ่มขึ้นอีก ประมาณ 10% และคาดว่าจะทำให้เบี้ยไอเออาร์ในประเทศเพิ่นขึ้นด้วย ขณะที่จำนวนงานเท่าเดิม&nbsp;<br />\r\n<br />\r\nเครดิต:&nbsp;<strong>โพสต์ทูเดย์</strong></span></div>\r\n\r\n<div style=\"background:#eeeeee; border:1px solid #cccccc; padding:5px 10px\"><span style=\"font-size:12px\">ที่มา :&nbsp;ทูเดย์อินชัวร์</span></div>\r\n', 0, 0, '2018-01-15 22:45:53', '2018-01-15 22:45:53', 'admin', 'admin', 'A');
