(7, '201801152313351.jpg', '201801152313352.jpg', 1, 'ไฟหน้าใหม่ รถก็ดูใหม่ได้ จัดโปรแพ็คคู่ แค่ 500 บาท', '<p>จัดโปร ขัดไฟ ขัดโคม จากปกติข้างละ 350 แพ็คคู่รับส่วนลดทันที 200 บาท เหลือ 500 บาทเท่านั้น</p>\r\n\r\n<p>หมดเขต 31 พ.ค. 2561</p>\r\n', 0, 0, '2018-01-15 23:13:35', '2018-01-15 23:14:07', 'admin', 'admin', 'A'),
(8, '201801152327331.jpg', '201801152327332.jpg', 1, 'โปรทำสีรอบคันแบบ Repaint Premium', '<p>เพื่อรถที่คุณรัก กับบริการทำสีรอบคัน คุณภาพ Premium</p>\r\n\r\n<p>ราคาปกติคิดเพิ่มจากราคาทำสีรอบคัน เกรดมาตรฐาน&nbsp;45%</p>\r\n\r\n<p>อัดโปรให้กับลูกค้าที่ทำสีรอบคันทั้งเงินสด และเคลมประกันภัย จ่ายเพิ่มเพียง 3,000 บาท คุณจะได้งานซ่อมคุณภาพระดับ Premium</p>\r\n\r\n<p>รายละเอียด</p>\r\n\r\n<p>1. คุณภาพสีมาตรฐานเกรด Nax Premila 2K Nippon paint เต็มระบบ</p>\r\n\r\n<p>2. ขัดเคลือบเงา 3 ขั้นตอน</p>\r\n\r\n<p>3. รับประกันคุณภาพงานสีสูงสุด 2 ปีเต็มสำหรับรยนต์ที่มีอายุไม่เกิน 1 ปี และ 1 ปี สำหรับรถยนต์ที่มีอายุ 2-5 ปี</p>\r\n\r\n<p>4. บริการงานทำสีระดับ Premium จากช่างผู้ชำนาญงานกว่า 20 ปี</p>\r\n', 0, 0, '2018-01-15 23:27:33', '2018-01-15 23:27:33', 'admin', 'admin', 'A');
